(3127, 'Abohar', 32, '<p><b>Abohar</b> is a municipal committee in Fazilka district of the Indian state of Punjab, north east of Sri Ganganagar and south east of Fazilka. Located near the junction of boundaries of Punjab, Haryana and Rajasthan and near the international border with Pakistan.</p><p>Abohar is famous for being one of the biggest cotton producing belt in whole north India and production of a citrus fruit named kinno. Abohar is 42km far from sri ganganagar</p>', 1),
