(5909, 'Eshkashem', 42, '<p><strong>Eshkashem</strong>, is a town in Badakhshan Province in north-eastern Afghanistan, the capital of Ishkashim District. It lies on the Panj River, at a point where its direction turns sharply north. Ishkashim lies opposite a town of the same name in Tajikistan, although the Tajik town is normally transliterated Ishkoshim following Tajik practice. A bridge opened in 2006 links the two towns.<img alt="" src="http://localhost/university/web/uploads/ckeditor/apple shimla7733.jpg" style="border-style:solid; border-width:4px; float:left; height:212px; margin:5px; width:248px" /></p>\r\n\r\n<p><span style="color:#FF0000">The town of Ishkashim lies in a fertile</span><a href="http://google.com"><span style="color:#FF0000"> valley</span></a><span style="color:#FF0000"> at an elevation of 3037 meters<sup>. </sup>There are roughly 20 settlements in the valley, but, considering the cultivation in the valley is continuous, it could also be considered one single, larger settlement. The total population of the valley is 121$2</span>0</p>\r\n\r\n<p>.</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 1),
