INSERT INTO `pages` (`id`, `name`, `slug`, `description`, `status`, `meta_keywords`, `meta_desc`, `meta_title`, `featured_image`) VALUES
(1, 'CSR', 'csr', '<div class="container-fluid">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="csr-text">\r\n<h1>Corporate Social Responsibility</h1>\r\n\r\n<h2>CSR is intrinsic to our growth story.<br />\r\nFrom just <b>‘giving’</b> we are increasingly working towards establishing a triple bottom line framework of laying equal importance to people, planet and profits.</h2>\r\n<span class="text-30">IS Paul</span>\r\n\r\n<h3>Drish is an ethics driven organization that practices sustainability and social responsibility in its sourcing, manufacturing, operations and marketing. We respect environment and the communities we work in, practice transparency in business and provide equal work opportunities to all cutting across cultures and gender.</h3>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="c-e"><img alt="environment" class="img-responsive" src="images/enviromment.jpg" title="environment" />\r\n<div class="commit-text">\r\n<h1>Commitment to environment</h1>\r\n\r\n<h6>Drish practices a strict code of practice in discharge of effluents and toxic waste into the environment. The Central Effluent Treatment Plant (CETP) treats every drop of effluent from the eight company’s tanneries located at the Leather Complex, Jalandhar. Realizing their environmental responsibilities Mr. IS Paul (MD) and Mr. Ajay Sharma (GM, Leather Production) were on the body of Punjab Effluent Treatment Society (PETS), thereby, through their expertise and guidance helped steer public policy in the direction.</h6>\r\n</div>\r\n</div>\r\n\r\n\r\n<div class="socity-img"><span><img alt="socity" class="img-responsive" src="/uploads/ckeditor/main/1469796342_CSR - 1.jpg" title="socity" /></span>\r\n\r\n<div class="socity-text">\r\n<h3>Commitment to society</h3>\r\n\r\n<h4>Children welfare</h4>\r\n\r\n<p>Drish stands by children of the disadvantaged sections of the society by helping them in their education, nutrition and health care needs. We support their caregivers by enhancing their capacity to earn through occupational training.</p>\r\n\r\n<p><b>Some initiatives to help the children include:</b></p>\r\n\r\n<ul class="list-text">\r\n	<li>i) Provision of books, stationery, school fees and liaison with SOS India for further evaluating and fulfilling the needs of the students.</li>\r\n	<li>ii) Facilitating visits of pediatrics, gynecologists, physicians and orthopedics in special camps for the children adopted and their families. Regularly holding workshops on health and hygiene and ensuring nutritional support and counseling.</li>\r\n	<li>iii) Celebrating days like Family Day, Children’s Day, etc.</li>\r\n	<li>iv) Supporting the Patiala School for the Deaf and Blind Children.</li>\r\n	<li>v) Holding workshops and sessions on child rights, HIV and AIDS prevention7, yoga and meditation.</li>\r\n	<li>vi) Donating children’s playing/sports equipment to PGI, Chandigarh. 77</li>\r\n	<li>vii) Supporting Rani Foundation that is doing a yeoman’s job in prevention and alleviation of breast cancer.</li>\r\n</ul>\r\n\r\n<div class="eco-text">\r\n<h4>Economic empowerment of families</h4>\r\n\r\n<p>Drish contributes to the cause of enhancing the livelihood of the weaker sections of society by empowering the families and making them self-reliant. Several vocational courses were organized on a frequent basis such as workshops for stitching and sewing, beauty, pig rearing training, running tea stalls, cloth shops and vegetable shops. Such vocational training has helped many individuals to get employed as beauticians, tailors, farmers and shop owners. The incomes of beneficiaries have increased ranging from 80% to 150% on an average.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<!-- end of socity area-->\r\n\r\n<div class="container-fluid craftsmanship-area">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="business-area">\r\n<div class="business-area-text">\r\n<h1>Commitment to responsible <span>business</span></h1>\r\n\r\n<p>Drish promotes ethical business practices among its stakeholders and fostering a culture of transparency and fair trade practices. We comply with safety and occupational hygiene standards at all our manufacturing and warehousing facilities. We are committed to a code of conduct that sets up high standards of morality and integrity. We respect the laws of the countries in which we operate and create a broad based framework of cross cultural engagement. Drish is a zero-tolerance company for any kind of discrimination and has equal respect for the mores and customs of all religions, regions and ethnicities.</p>\r\n</div>\r\n\r\n<div class="business-img"><img alt="business-img" class="img-responsive" src="/uploads/ckeditor/main/1469524384_business-img.jpg" title="business-img" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 1, 'CSR', 'CSR', 'CSR', '1460100710.jpg'),
(2, 'Culture', 'culture', '<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="csr-text">\r\n<h1>Customer first</h1>\r\n\r\n<h2>By nature we are a customer focused organization; we have built the edifice of the company basing it on everyday walking comfort of our customer.</h2>\r\n<span class="text-30">IS Paul</span></div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-12 col-sm-12 col-md-12 col-xs-12">\r\n<div class="culture-shoes"><img alt="culture-shoes" class="img-responsive" src="images/culture-shoes.jpg" title="culture-shoes" />\r\n<div class="culture-text">\r\n<h3>Customer first here is not an ‘approach’ but a ‘culture’, which nurtured and nourished for over three decades, percolates from the visionary leadership into the fabric of the organization. Everyone at Drish is imbued by a deeply personal and passionate spirit for understanding the needs of the customer and assimilating ‘consumer insights’ into product value chain to create a ‘superior user experience.’ The ever growing global customer base is the primary metric of our success and we believe in amassing ‘satisfied smiles.’ The more we earn this unique wealth, the poorer we feel.</h3>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 0, 'Culture', 'Culture', 'Culture', '1462260273.jpg'),
(3, 'Craftsmanship', 'craftsmanship', '<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="is-paul">\r\n<h3>Leather evokes trust and emotions.<br />\r\nIt is reliable and lasting. It accents lifestyles.</h3>\r\n<span class="text-50">IS Paul</span></div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12"><img alt="is-paul" class="img-responsive" src="images/is-paul-img.jpg" title="is-paul" /></div>\r\n</div>\r\n\r\n<div class="container-fluid craftsmanship-area">\r\n<div class="row">\r\n<div class="col-lg-12">\r\n<div class="relish">\r\n<h4>There is an inbuilt tradition in whatever we do. Our tanners work closely with our artisans to understand the needs of their workmanship and give them the best and uniquely created raw material. Precision cut, the leather pieces are sewn, styled and pasted by craftsman with subtle skills and an amazing eye for finesse and detail to create timeless beauties.</h4>\r\n\r\n<p>We relish your joy when you wear them.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 0, 'Craftsmanship', 'Craftsmanship', 'Craftsmanship', '1462260493.jpg'),
(4, 'Why Leather', 'why-leather', '\r\n<section class="why-leath">\r\n<div class="outer-container">\r\n<div class="why-img">\r\n<p>Leather has been in use by the mankind for making shoes and other objects of general use since times immemorial. Leather is bestowed with special qualities that make it stand apart from a large number of fabrics and synthetic materials. Craftsmanship and expertise is as important in making leather products as the quality of the selected hide, its process control and treatment.</p>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<div class="leather-material">\r\n<div class="step-leather-count">\r\n<div class="row">\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="choose-numer">\r\n<h4>01</h4>\r\n\r\n<div class="choose-material">\r\n<p>Leather a wise <span>choice over</span> <small> other material</small></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="material-detail">\r\n<p>Though leather involves more investment initially but it lasts twice as long as other fabrics and synthetic leather. It gives quality service like no other material. Leather shoes have high durability.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="choose-numer">\r\n<h4>02</h4>\r\n\r\n<div class="choose-material">\r\n<p>Leather breathes</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="material-detail">\r\n<p>Being a natural material, leather has ‘organic’ properties. It can breathe and prevent sweaty and smelly feat. The parameters for measuring the breathing property are water vapour permeability (WVP), water vapour absorption (WVA) and water vapour coefficient (WVC). Breathability also prevents its ageing and foul smell.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="choose-numer">\r\n<h4>03</h4>\r\n\r\n<div class="choose-material">\r\n<p>Soft and Supple</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="material-detail">\r\n<p>Leather is a natural material that is soft, supple and flexible. It is the only material that gives the necessary comfort to the foot by flexing as per foot’s requirements.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="choose-numer">\r\n<h4>04</h4>\r\n\r\n<div class="choose-material">\r\n<p>Aesthetics</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="material-detail">\r\n<p>Leather has rich and varying textures giving it an aesthetic and pleasing appeal. It can accept nourishment to maintain its shine and elongate its life.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="choose-numer">\r\n<h4>05</h4>\r\n\r\n<div class="choose-material">\r\n<p>Anti-allergic</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="material-detail">\r\n<p>Leather, when properly treated, by itself is anti-allergic and the chances of getting allergies, irritations and skin ailments are more from the synthetic shoes. So a customer can be surer of good foot health with leather than other material.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="choose-numer">\r\n<h4>06</h4>\r\n\r\n<div class="choose-material">\r\n<p>Thermoregulation</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="material-detail">\r\n<p>Leather micro-pores trap a large amount of air and provide excellent insulation – leather can be warm in winter and cool in summer.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="choose-numer">\r\n<h4>07</h4>\r\n\r\n<div class="choose-material">\r\n<p>Eco-sustainability</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-6 col-md-6 col-sm-6 col-xs-6 full">\r\n<div class="material-detail">\r\n<p>Contrary to popular belief, leather industry doesn’t slaughter animals. It uses the skins and hides that are a by-product of the meat industry. If not used, it would putrefy leading to atmospheric pollution, and could contribute to spread of animal and human diseases besides emanating foul smell. Therefore, leather is an eco-sustainable material that doesn’t put pressure on the natural</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="leather-p-note leather-note">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<p>NOTE: «The hallmark of genuine leather is its natural marks and imperfections, like wrinkles or folds – nature’s signature that enhances the beauty and uniqueness of leather. Any imperfection in leather is not a defect but rather evidence of its genuinity</p>\r\n\r\n<p>Unlike synthetic faux leather that is all chemicals and non-biodegradable, Genuine Leather, being a natural product, is body friendly and has minimal chemicals, which, if there, are as per European laws.»</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n', 1, 'Why Leather', 'Why Leather', 'Why Leather', '1462260507.jpg'),
(5, 'Our Story', 'our-story', '<div class="container-fluid craftsmanship-area brand-main">\n<section class="drish-story">\n<div class="row">\n<div class="col-lg-7 col-md-7 col-sm-12 col-xs-12">\n<h3>The Drish story</h3>\n\n<p>We share a humble beginning, with many other success stories. Yet our inception was innovatively inspired; we were guided by creativity and we resolutely believed in the possibilities of teamwork and potential of technologies. With modest financial inputs but far-sighted perspective we soon achieved economies of scale to become a venture with strong brand equity. The story of Drish spans twenty eight years of endeavour and achievement. The company consistently ventured into more areas of capabilities, enhancing capacities and foraying into different regions and territories to today establish itself as a leader in manufacturing leather, leather accessories and footwear of global reputation.</p>\n\n<p>Beginning in 1988 with upper making and leather finishing, Drish rapidly established its manufacturing facilities of tanning and shoe making by the early 90s. Units were set up with state-of-the-art machinery and equipment of European origin (primarily German technology). Focus primarily was on increasing production volumes and sustaining quality. The next stage beginning in the mid-90s to 2015, was the time of rapid market consolidation with focus on sales, forward vertical integration and retail venturing. Drish acquired two German brands—Fortuna and Manz. Buffalo calf leather ‘Chandi’ became the bestselling leather brand out of India and the company and revenues increased rapidly. Drish has been making formidable strides in the last half decade. Paul Drish, an online brand has been launched in the US. Prestigious names likes Van den Assem and ABCD have joined the customers list. A children’s shoe collection is launched online in India and much more is in the offing.</p>\n</div>\n\n<div class="col-lg-5 col-md-5 col-sm-12 col-xs-12">\n<div class="drish-story-img"><img alt="craftsmanship" drish-global="" src="/uploads/ckeditor/main/1469517606_craftsmanship.jpg" style="height: 640px;" /></div>\n</div>\n</div>\n</section>\n\n<section class="drish-global">\n<div class="row">\n<div class="col-lg-12">\n<h3>Drish Global</h3>\n\n<p>Over the years, Drish has been spreading its wings overseas and setting up a global footprint especially in the Europe and the US. Drish has consistently expanded marketing operations in Europe and carried out strategic vertical integration by acquiring brand assets Manz and Fortuna in Germany—over century-old brands manufacturing leather shoes and leather accessories. The acquisition of Schuhfabrik Manz GmbH made in 2008 brought into the Drish fold design and development centres along with a strong retail presence and loyal customer base. The company was christened Manz Fortuna GmbH.</p>\n\n<p>The second major foray of Drish has been across the Atlantic into the US. Paul Drish, a premium luxury brand offers a wide range of men’s formal shoes, sneakers, loafers and leather bags. The products being exclusively retailed through an online store are patronised by connoisseurs of leather shoes and bags.</p>\n</div>\n</div>\n</section>\n\n<section class="customer-say">\n<div class="row">\n<div class="col-lg-5 col-md-5 col-sm-5 col-xs-12">\n<h3>Customer first</h3>\n<span>“By nature we are a customer focused organization; we have built the edifice of the company basing it on everyday walking comfort of our customer.” - IS Paul </span>\n\n<p>Customer first here is not an ‘approach’ but a ‘culture’, which nurtured and nourished for over three decades, percolates from the visionary leadership into the fabric of the organization. Everyone at Drish is imbued by a deeply personal and passionate spirit for understanding the needs of the customer and assimilating ‘consumer insights’ into product value chain to create a ‘superior user experience.’ The ever growing global customer base is the primary metric of our success and we believe in amassing ‘satisfied smiles.’ The more we earn this unique wealth, the richer we feel.</p>\n</div>\n\n<div class="col-lg-2 col-md-2 col-sm-2 col-xs-2"><img alt="border" class="center-block" src="images/content-border-img.jpg" /></div>\n\n<div class="col-lg-5 col-md-5 col-sm-5 col-xs-12">\n<h3>Drish craftsmanship</h3>\n<span>“Leather evokes trust and emotions. It is reliable and lasting. It accents lifestyles.” -IS Paul</span>\n\n<p>There is an inbuilt tradition in whatever we do. Our tanners work closely with our artisans to understand the needs of their workmanship and give them the best and uniquely created raw material. Skillfully cut, the leather pieces are sewn, styled and pasted by craftsmen with skill and an amazing eye for finesse and detail to create timeless beauties.<br />\n<br />\nWe relish your joy when you wear them.</p>\n</div>\n</div>\n</section>\n\n<section>\n<div class="container">\n<div class="row">\n<div class="col-lg-12">&nbsp;</div>\n</div>\n</div>\n</section>\n</div>\n', 1, 'Our Story', 'Our Story', 'Our Story', '1462260551.jpg'),
(6, 'Shoe Care', 'shoe-care', '<div class="container-fluid c-f-pad">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="why-leather-text our-text">\r\n<h2 class="text-50">CARING FOR YOUR DRISH PURCHASE</h2>\r\n\r\n<p>The longevity of a pair of leather shoes is highly dependent on its proper care and maintenance.</p>\r\n\r\n<p>Here are some tips to take better care of your purchase.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end of shoe care text-->\r\n\r\n<div class="shoe-care-step">\r\n<div class="shoe-care-outer">\r\n<div class="row">\r\n<div class="col-lg-3 col-md-3 col-sm-7 col-xs-12"><img alt="shoe-care-step" class="img-responsive sc" src="images/shoe-care-step.jpg" title="shoe-care-step" /></div>\r\n\r\n<div class="col-lg-8 col-md-8 col-sm-5 col-xs-12">\r\n<h3>01</h3>\r\n\r\n<p>Keep your shoes in a location far removed from any direct heat or sunlight which can damage leather, causing it to fade or become dry and cracked. Exposure to water, oil, makeup, and permanent dyes can stain tanned leathers.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- endof step- 1 shoe care-->\r\n\r\n<div class="shoe-care-outer">\r\n<div class="row">\r\n<div class="col-lg-3 col-md-3 col-sm-5 col-xs-12 mob-shoe-care"><img alt="shoe-care-step" class="img-responsive sc" src="images/shoe-care-step-2.jpg" title="shoe-care-step" /></div>\r\n\r\n<div class="col-lg-8 col-md-8 col-sm-7 col-xs-12">\r\n<div class="shoe-care-right">\r\n<h3>02</h3>\r\n\r\n<p>Leather is not weatherproof. Hence, if your shoe ever gets even slightly wet, put it out in the sun away from direct heat for at least a day to dry. If you''ve just stepped out of a shower, make sure your feet are fully dry before slipping on your shoes..</p>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-3 col-md-3 col-sm-5 col-xs-12 desk-shoe-care"><img alt="shoe-care-step" class="img-responsive sc" src="images/shoe-care-step-2.jpg" title="shoe-care-step" /></div>\r\n</div>\r\n</div>\r\n<!-- endof step- 2 shoe care-->\r\n\r\n<div class="shoe-care-outer">\r\n<div class="row">\r\n<div class="col-lg-3 col-md-3 col-sm-7 col-xs-12"><img alt="shoe-care-step" class="img-responsive sc" src="images/shoe-care-step-3.jpg" title="shoe-care-step" /></div>\r\n\r\n<div class="col-lg-8 col-md-8 col-sm-5 col-xs-12">\r\n<h3>03</h3>\r\n\r\n<p>Shoes should be conditioned and polished on a regular basis to keep the leather supple and well moisturized. Polish your shoes with shoe polish or a shoe cream at least thrice a week.</p>\r\n\r\n<p>A damp cloth may be used to take off the loose dirt. Use a soft brush to apply shoe polish/ cream evenly on the shoe. Let it dry for a couple of minutes. Then use a dry but harder brush as well as a dry cloth to bring out the shine.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- endof step- 3 shoe care-->\r\n\r\n<div class="shoe-care-outer">\r\n<div class="row">\r\n<div class="col-lg-8 col-md-8 col-sm-5 col-xs-12">\r\n<div class="col-lg-3 col-md-3 col-sm-5 col-xs-12 mob-shoe-care"><img alt="shoe-care-step-4" class="img-responsive sc" src="images/shoe-care-step-4.jpg" title="shoe-care-step-4" /></div>\r\n\r\n<div class="shoe-care-right">\r\n<h3>04</h3>\r\n\r\n<p>If it snows where you live, chances are that you''ve encountered the ugly white ridges that appear on your leather shoes caused by salt that is used to keep ice off of the street. Mix white vinegar and water, and dab on sparingly using a soft cloth to remove these unsightly marks. Then apply shoe polish..</p>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-3 col-md-3 col-sm-5 col-xs-12 desk-shoe-care"><img alt="shoe-care-step-4" class="img-responsive sc" src="images/shoe-care-step-4.jpg" title="shoe-care-step-4" /></div>\r\n</div>\r\n</div>\r\n<!-- endof step- 4 shoe care-->\r\n\r\n<div class="row">\r\n<div class="col-lg-3 col-md-3 col-sm-7 col-xs-12"><img alt="shoe-care-step-5" class="img-responsive sc" src="images/shoe-care-step-5.jpg" title="shoe-care-step-5" /></div>\r\n\r\n<div class="col-lg-8 col-md-8 col-sm-5 col-xs-12">\r\n<h3>05</h3>\r\n\r\n<p>Avoid contact with heavy chemicals and other abrasive materials. Avoid using lacquers.</p>\r\n</div>\r\n</div>\r\n<!-- endof step- 5 shoe care-->\r\n\r\n<div class="shoe-care-outer">\r\n<div class="row">\r\n<div class="col-lg-8 col-md-8 col-sm-5 col-xs-12">\r\n<div class="col-lg-3 col-md-3 col-sm-5 col-xs-12 mob-shoe-care"><img alt="shoe-care-step-6" class="img-responsive sc" src="images/shoe-care-step-6.jpg" title="shoe-care-step-6" /></div>\r\n\r\n<div class="shoe-care-right">\r\n<h3>06</h3>\r\n\r\n<p>Never put your shoes in a plastic bag or any other nonporous material, as this can contribute to the growth of mildew. Store your products in the box in which they were delivered.</p>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-3 col-md-3 col-sm-5 col-xs-12 desk-shoe-care"><img alt="shoe-care-step-6" class="img-responsive sc" src="images/shoe-care-step-6.jpg" title="shoe-care-step-6" /></div>\r\n</div>\r\n</div>\r\n<!-- endof step- 2 shoe care--></div>\r\n</div>\r\n<!-- end of shoe care step-->\r\n\r\n<div class="tips">\r\n<div class="container-fluid c-f-pad">\r\n<h3 class="text-50">TIPS FOR PATENT LEATHER</h3>\r\n\r\n<div class="row">\r\n<div class="col-lg-3 col-sm-6 col-md-6 col-xs-6 tips-patent">\r\n<div class="tip-inner"><img alt="shoe-tips" src="images/shoe-tips.png" title="shoe-tips" />\r\n<div class="caption">\r\n<p>Patent leather is made from real leather finished with a mixture of acrylic and polyurethane which gives a longer lasting, durable finish. Clean it using a dry cloth or soft and dry brush. Dirt adhering to patent can be easily removed with a damp cloth.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-3 col-sm-6 col-md-6 col-xs-6 tips-patent">\r\n<div class="tip-inner"><img alt="shoe-tips-2" src="images/shoe-tips-1.png" title="shoe-tips-2" />\r\n<div class="caption">\r\n<p>With wear, patent leather may eventually lose its glossy finish..</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-3 col-sm-6 col-md-6 col-xs-6 tips-patent">\r\n<div class="tip-inner"><img alt="shoe-tips-3" src="images/shoe-tips-2.png" title="shoe-tips-3" />\r\n<div class="caption">\r\n<p>Patent will easily absorb ink or pigments so we advise that products are kept in their box when not in use and avoid contact with dark or heavily printed materials.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-3 col-sm-6 col-md-6 col-xs-6 tips-patent">\r\n<div class="tip-inner"><img alt="shoe-tips-4" src="images/shoe-tips-3.png" title="shoe-tips-4" />\r\n<div class="caption">\r\n<p>Care should be taken to avoid contact with alcohol or any type of solvent.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end of tips blog-->\r\n\r\n<div class="col-padding">\r\n<div class="col-lg-6 col-sm-12 col-md-6 col-xs-12 col-padding"><img alt="tips-skin" class="img-responsive" src="images/tips-img-skin.jpg" title="tips-skin" /></div>\r\n\r\n<div class="col-lg-6 col-sm-12 col-md-6 col-xs-12 tips-skin">\r\n<div class="tips-deerskin">\r\n<h3 class="text-50">TIPS FOR DEERSKIN</h3>\r\n\r\n<p><span>01</span>Deerskin leather is resilient with a luxurious finish. It is the softest leather known to man. Please avoid contact with sharp points or surfaces that may scrape and damage upper leather.</p>\r\n\r\n<p><span>02</span>Please be aware that any metallic finishing may wear off with time and use. Care should be taken to avoid contact with liquids containing alcohol or solvents..</p>\r\n\r\n<p><span>03</span>A damp cloth may be used to wipe away any loose dirt. A crepe rubber can be used to remove fixed dirt. Apply shoe polish or cream evenly with a brush or soft cloth. Let it dry for a few moments. Then brush with a dry cloth or brush to bring back its original finish.</p>\r\n</div>\r\n</div>\r\n</div>\r\n', 1, 'Shoe Care', 'Shoe Care', 'Shoe Care', '1462260473.jpg'),
(7, 'Revosize', 'revosize', '\r\n<div class="why-leather-text revosize-text">\r\n<h4>Amongst our recent accomplishments is <span>RevoSize™-</span></h4>\r\n<p>the revolutionary in-house technology to measure foot size is setting new standards in online shopping of shoes.</p>\r\n</div>\r\n<div class="revosize-primer"><img alt="revosize-primer" class="img-responsive" src="images/revosize-primer.jpg" title="revosize-primer" />\r\n<div class="revosize-primer-text">\r\n<h4 class="text-50">RevoSize™ - A Primer</h4>\r\n\r\n<p>There is no organized effort in our country to make ‘correct’ shoes for children to ensure foot health, and there are no trained shoe fitters. The foot girth starts getting wider from about age 5 in boys and age 6 in girls. As a result foot problems like pronation, hallux valgus, corns, hammer toes, smelly feet etc. start showing in children at a very young age. In most cases these problems are caused due to wearing incorrect footwear. 70% foot problems in adults are caused due to wrong footwear worn during childhood. RevoSize ™ helps manufacture BESPOKE SHOES for people whose footwear demands cannot be met with the existing styles.</p>\r\n</div>\r\n</div>\r\n\r\n<div class="grid-measurment">\r\n<div class="container-fluid c-f-pad">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<ul class="address grid-foot">\r\n	<li><span id="gridbtn1">Step 1: Grid Measurement</span>\r\n\r\n	<div class="detail-shipping" id="griddiv1" style="display:block;">\r\n	<div class="grid-meas">\r\n	<div class="need-finer">\r\n	<ul>\r\n		<li class="text-30">You need:</li>\r\n		<li><img alt="fine-pencil" src="images/fine-pencil-need.png" title="fine-pencil" />\r\n		<h6>1 fine-nib pen or pencil</h6>\r\n		</li>\r\n		<li><img alt="fine-pencil" src="images/a4-sheet-need.png" title="fine-pencil" />\r\n		<h6>2 A4 sheets</h6>\r\n		</li>\r\n		<li><img alt="fine-pencil" src="images/measuring-tape-need.png" title="fine-pencil" />\r\n		<h6>Measuring Tape</h6>\r\n		</li>\r\n	</ul>\r\n	</div>\r\n	</div>\r\n\r\n	<div class="step-number-grid">\r\n	<ul>\r\n		<li><img alt="step-1" src="images/step-1.png" title="step-1" />\r\n		<h5>Step 1</h5>\r\n\r\n		<h6>Click on the link to download the measurement grid</h6>\r\n		<a class="btn-trans" href="images/grid.jpg" target="_blank">Measurement Grid</a></li>\r\n		<li><img alt="step-2" src="images/step-2.png" title="step-2" />\r\n		<h5>Step 2</h5>\r\n\r\n		<h6>Print 2 copies of the grid on an A4 sheet. Remember to select the ‘do not scale’ option in Print Properties. A measuring scale is pdrovided on the left side of the sheet. Please cut this along the dotted line. It will be used later for measurement.</h6>\r\n		</li>\r\n		<li><img alt="step-2" src="images/step-2.png" title="step-3" />\r\n		<h5>Step 3</h5>\r\n\r\n		<h6>Mark the ‘Left’ checkbox on one sheet and the ‘Right’ checkbox on the other.</h6>\r\n		</li>\r\n		<li><img alt="step-2" src="images/step-2.png" title="step-4" />\r\n		<h5>Step 4</h5>\r\n\r\n		<h6>Place your child’s right foot in the centre of the sheet marked ‘right’. Ask the child to put pressure on the right foot, and to look straight ahead (and NOT down at his/her feet).</h6>\r\n		</li>\r\n		<li><img alt="step-5" src="images/step-3.png" title="step-5" />\r\n		<h5>Step 5</h5>\r\n\r\n		<h6>Get a pencil or a pen and bend over. You should be facing the toes of the child (NOT the heel).</h6>\r\n		</li>\r\n		<li><img alt="step-6" src="images/step-4.png" title="step-6" />\r\n		<h5>Step 6</h5>\r\n\r\n		<h6>Draw an outline of the child’s right foot. Start from the outer side of the foot and slowly move over the heel and towards the toes, then over the toes and continue down the outer side of the foot till the pen reaches the point where you started.</h6>\r\n		</li>\r\n		<li><img alt="step-7" src="images/step-9.png" title="step-7" />\r\n		<h5>Step 7</h5>\r\n\r\n		<h6>Get the measuring scale cut out from the A4 sheet and place it under the ball of the child’s foot. The girth should be measured by placing the scale in such a way that it covers the widest points of the ball (i.e. the first and fifth metatarsal bone joint). Now, move the scale over the foot and determine the girth of the foot, as shown.</h6>\r\n		</li>\r\n		<li><img alt="step-8" src="images/step-6.png" title="step-8" />\r\n		<h5>Step 8</h5>\r\n\r\n		<h6>Ask the child to remove his/her foot from the paper. Draw a horizontal line at the top-most and bottom-most point of the foot outline. Measure the distance between the two horizontal lines using the measuring scale. Write down the length and girth in the space provided.</h6>\r\n		</li>\r\n		<li>\r\n		<h5>Step 9</h5>\r\n\r\n		<h6>Repeat steps 4 to 8 for the left foot. When drawing the outline for the left foot, start from the inner side of the foot.</h6>\r\n		</li>\r\n		<li>\r\n		<h5>Step 10</h5>\r\n\r\n		<h6>Send us a photo or scanned copy of the two sheets, along with the results of Step 2: Accu Foot Size.</h6>\r\n		</li>\r\n		<li>&nbsp;</li>\r\n		<li>&nbsp;</li>\r\n	</ul>\r\n	</div>\r\n\r\n	<div class="measurment-text-need">\r\n	<div class="fitting-need">\r\n	<p>Please preserve these sheets to compare with future measurements done of your child’s feet.</p>\r\n\r\n	<p>If you have any queries or concerns regarding the measurement of feet through this method, do get in touch with us through phone <b>(toll-free number: 1800 137 0107)</b> or email <b>(support@drish.com)</b>.</p>\r\n	</div>\r\n\r\n	<p>Depending on the girth of the foot, we offer two width fittings - Normal and Wide, or Wide and Extra Wide - in shoes from sizes 32 to 39. Please note that Normal is equivalent to E width, Wide is equivalent to H width and Extra Wide is equivalent to K width fittings. Please refer to our Size Chart for more information.</p>\r\n	</div>\r\n\r\n	<div class="step-video">\r\n	<h3>Watch video for step by step instructions</h3>\r\n	<iframe allowfullscreen="" class="revo-size-iframe" frameborder="0" src="https://www.youtube.com/embed/crv1nYLmhBI"></iframe></div>\r\n	</div>\r\n	</li>\r\n	<li><span id="gridbtn2">Step 2: Accu Foot Size</span>\r\n	<div class="detail-shipping" id="griddiv2">\r\n	<p>You need: A smart phone, an A4 sheet of paper<br />\r\n	<br />\r\n	Accu Foot Size, our in-house patented app, will help you accurately derive your shoe size including length and girth of your foot, making it easy for you to pick the perfect shoes for your children and yourself while shopping online. Accu Foot Size incorporates a correlation factor that is based on a survey conducted over a population of 1890 adults and 752 children. The correlation factor gives indicative foot girth from the foot width.<br />\r\n	<br />\r\n	Accuracy of the measurement will depend on quality of the picture, proper alignment of the sheet with the boundary on your camera view and the precision with which you manually calibrate for calculation of the length and width of your child’s foot.<br />\r\n	<br />\r\n	<strong>Accu Foot Size is the only 2D app in the world which gives the length and width of the foot with less than 3 mm margin of error. It also derives the ball girth of the foot with margin of error being less than 4 mm for feet with normal width and thickness.</strong> For feet with larger widths and thickness, the error could be between 4-8 mm.<br />\r\n	<br />\r\n	To determine the shoe size, all you need are the length, the width and hence the ball girth of the foot. No other device including 2D scanners achieve measurement of the length, width and the ball girth at the same time.<br />\r\n	<br />\r\n	Step-wise instructions are given in the app. You can also read these instructions on the website: &lt; a href="www.accufootsize.com" target="_blank"&gt;www.accufootsize.com<br />\r\n	<br />\r\n	<strong>The iOS app is opimized for:</strong> iPhone 5, iPhone 5C, i Phone 5S, iPhone 6, iPhone 6 Plus, i Phone 6S, iPhone 6S Plus. If you want our team to re-confirm your size, please login to the app. <a href="#">Click here To Download iOS App</a>.<br />\r\n	<br />\r\n	<strong>The Android app is optimized for:</strong> Samsung galaxy Note 4, LG G4, Samsung Galaxy S6, Samsung Galaxy S6 Edge, Samsung Galaxy S6 Active, Samsung Galaxy A8, Samsung Galaxy Note 5, Samsung Galaxy S5 Plus, Xiomi MI5, Xiomi MI3, Samsung Canvas Turbo A25, Sony Experia C4, Lenovo Vibe X2 Pro, HTC Desire 826, Samsung Galaxy Grand Max, Asus Zenfone 2 ZE551ML, LG G Flex 2, Samsung Galaxy E7, Lenovo P90, Asus Zenfone Zoom ZX550 <a href="#">Click here To Download Android App</a>.<br />\r\n	<br />\r\n	Email us the results of step 1 and step 2 and we will get back to you with your child’s correct shoe size within 1 working day. Please email the following information to <a href="mailto:support@drish.com">support@drish.com</a>:</p>\r\n\r\n	<ul>\r\n		<li>Your Name</li>\r\n		<li>Child’s Name</li>\r\n		<li>Child’s age</li>\r\n		<li>Child’s Gender</li>\r\n		<li>Foot Problems (if any)</li>\r\n	</ul>\r\n	<br />\r\n	<br />\r\n	If you have any queries or concerns regarding the use of this app, do get in touch with us through phone (toll-free number: 1800 137 0107) or email (<a href="mailto:support@drish.com">support@drish.com</a>)\r\n\r\n	<p>&nbsp;</p>\r\n	</div>\r\n	</li>\r\n	<li><span id="gridbtn3">Step 3: Insole Strip</span>\r\n	<div class="detail-shipping" id="griddiv3">In the shoe box, you will find a strip of chart paper marked the “insole." The length of this insole strip is equal to the length of the insole of the shoe, which is the distance between the farthest point at the toe and the back part inside the shoe. This means that it should be the length of your child’s foot plus 9-15 mm, which is the “growing room” or the extra space needed for growth. The following steps will tell you how to use this strip to confirm your child’s size:<br />\r\n	&nbsp;\r\n	<div class="insole-image"><img class="img-responsive" src="images/Insole.jpg" /></div>\r\n	<br />\r\n	<br />\r\n	1. Put the insole strip on the floor and have the child stand on it. The back edge of the heel of the foot should be aligned with the bottom edge of the strip\r\n	<div class="insole-image"><img class="img-responsive" src="images/Insole-intro1.jpg" /> <img class="img-responsive" src="images/Insole-intro2.jpg" /></div>\r\n	<br />\r\n	<br />\r\n	2. Mark the end of the child''s longest toe on the insole with a pen. This mark must lie within the shaded area of the insole, i.e., it must be between 9 and 15 mm from the tip of the insole.\r\n	<div class="insole-image"><img class="img-responsive" src="images/Insole1.jpg" /> <img class="img-responsive" src="images/Insole2.jpg" /></div>\r\n	<br />\r\n	<br />\r\n	3. Now put the strip inside the shoe. If the strip fits in the shoe without bending or buckling, the shoe is the right fit for your child. If the strip moves back and forth in the shoe, it is too long. If it bends, the shoe is short. If the big toe or the longest finger stay within the shaded portion of the insole the shoes need no change. However, if the big toe or the longest finger is jutting beyond the shaded portion, the wiggle room becomes smaller than the minimum needed 9 m.m. spare length at the toe that is necessary to accommodate the growth of your child’s foot. It is then time to change your child’s shoe.\r\n	<div class="insole-image"><img class="img-responsive" src="images/Insole3.jpg" /> <img class="img-responsive" src="images/Insole4.jpg" /></div>\r\n	<br />\r\n	<br />\r\n	4. Please use this insole to track the growth of your child’s foot every four months in case the child is between ages 6 months to 3 years and every six months for children beyond the ages of 3 years. Children''s feet grow in spurts - refer to the section PARENTS'' GUIDE for more information. If you find a problem with the shoe, do get in touch with us through phone (toll-free number: 1800 137 0107) or email (<a href="mailto:support@drish.com">support@drish.com</a>).<br />\r\n	&nbsp;\r\n	<div class="step-video">\r\n	<h3>Watch video for step by step instructions</h3>\r\n	<iframe allowfullscreen="" class="revo-size-iframe" frameborder="0" src="https://www.youtube.com/embed/vkIRjrOgsKI"></iframe></div>\r\n	</div>\r\n	</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="accu-foot">\r\n<div class="container-fluid">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<h3 class="text-50">Accu Foot Size App</h3>\r\n\r\n<p>Accu Foot Size, our self developed patented app gives the correct shoe size in a few simple steps. It helps the customers derive their shoe size including length and width of the foot, making it easy for them to pick the perfect shoes for themselves and children while shopping online. It is the only 2D app in the world, which gives the length and width of the foot with less than 4 mm margin of error. If the user logs in with their details, he or she can also consult our in house team of sizing experts. This app is available on iOS as well as Android store.</p>\r\n\r\n<div class="app-store"><img alt="app-stor" src="images/app-store.jpg" title="app-store" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 1, 'Revosize', 'Revosize', 'Revosize', '1462260571.jpg'),
(8, 'Research & Development', 'research-development', '<div class="container-fluid craftsmanship-area">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="csr-text">\r\n<h2>We are in constant endeavour to assess customer lifestyle needs and physical characteristics of feet. We evaluate the findings in developing better leather products solutions.</h2>\r\n<span class="text-30">- IS Paul</span></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="container-fluid craftsmanship-area">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12 re-blog-bg">\r\n<div class="reserch-blog-img"><img alt="research blog" class="img-responsive" src="/uploads/ckeditor/main/1469793755_R&amp;D - 1.jpg" /></div>\r\n\r\n<div class="re-block-text">\r\n<h3>Due to quality, comfort and style, Drish has stimulated a high demand of footwear and other leather products. This increased demand has been instrumental in improving our leather processing technology, enlarging our manufacturing capacities and increasing productivity. We have some of the most advanced equipment to conduct research and development on leather, shoes and accessories to make better products. Our continuous investment in the area helps us evolve and meet customer expectations by maintaining consistency in quality.</h3>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-12 col-sm-12 col-md-12 col-xs-12">\r\n<div class="oue-engineer">\r\n<p>Our engineers and technologists regularly conduct foot surveys to understand the structures and sizes of feet of males, females and children. The surveys help us develop more models of comfortable, stylish and aesthetically pleasing shoes with great fit. The R&amp;D efforts at Drish are also largely focused on designs, which are largely inspired from German and Spanish trends. Our designers work with season’s fresh approach on creating fresh designs, colour combinations, patterns, and use of trims and embellishments round the year. Fit trials and modification is an ongoing feature to ensure a perfect fit across complete size range.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="reserch-blog-img mob-shoe-care"><img alt="research blog" class="img-responsive" src="/uploads/ckeditor/main/1469796144_R&amp;D - 2.jpg" title="reserach-blog" /></div>\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12 re-blog-bg">\r\n<div class="re-block-text re-devel">\r\n<h3>There are continued efforts for researching and developing different chemical combinations, dyes, colours and prints. Bettering chemical usage and treatment in leather tanning remains a key area of focus in light of developments in eco-sustainability.</h3>\r\n</div>\r\n<div class="reserch-blog-img desk-shoe-care"><img alt="research blog" class="img-responsive" src="/uploads/ckeditor/main/1469796144_R&amp;D - 2.jpg" title="reserach-blog" />\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 1, 'Research & Development', 'Research & Development', 'Research & Development', '1462260579.jpg'),
(9, 'Quality Control', 'quality-control', '<div class="container-fluid">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="csr-text l-text">\r\n<h1>Leather</h1>\r\n\r\n<h2>Leather is a non-homogenous material, which makes its quality check a complex exercise. Depending upon the end use of leather, it is tested through a wide spectrum of tests for evaluating conformance to quality over various parameters. These include visual, chemical and physical tests.</h2>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="leather-left">\r\n<p>The most important parameter in leather quality is the fibre structure. Basic physical tests conducted are for tensile property, elongation, rub fastness, flexing, stitch tear and tongue tear strength. Other quality control measures include flexing test, grain crack/distension, colour fastness, shrinkage test, water vapour permeability and water absorption. Chemical testing helps evaluate the presence of essential chemicals in leather in light of eco-sensitivity as well as their quality enhancing properties. The lab has equipment like UV-visible spectrophotometer, GC and HPLC, which function in temperature and humidity controlled environments. Boil test is done to ascertain the tanning quality of leather. Patch test is done by taking small swatch and dyeing it. PH control is maintained throughout the process in addition to temperature control. The dyed material after ageing is taken to Setting Section and the material is inspected lot wise check for proper setting. After setting operation, material is taken to vacuum operations and vacuum operation is done at a particular temperature and timing is also maintained. Thereafter material is sent for conveyor drying and finally passed through drying chamber keeping check on temperature and humidity. General tests are conducted that include free Formaldehyde testing (Gas Chromatography), CR-VI, PCP and AZO to ensure that the leather is free of all toxicities and chemicals do not exceed permissible limits. The material is then visually examined through sampling by a team of five senior quality control personnel.</p>\r\n</div>\r\n<div class="leather-img"><img alt="leather" class="img-responsive" src="/uploads/ckeditor/main/1469524704_leather.jpg" title="leather" /></div>\r\n\r\n\r\n<div class="leather-img l-d-desk-view"><img alt="leather" class="img-responsive" src="/uploads/ckeditor/main/1469528824_research-blog-1.jpg" title="leather" /></div>\r\n<div class="leather-left l-d">\r\n<h3>Leather products</h3>\r\n<p>Shoes and other leather products exceed the customer requirements and match globe-wide standards of quality. This quality is ensured through stringent quality processes at all stages of production. Drish uses only home produced leather from its own tanneries. The leather is visually examined through sampling techniques to ensure conformance with the sample approved for production. The manufacturing process begins with leather component cutting. Cutting is done as per samples provided by the sample development team. Cut components are then checked and passed by QC team for production. Quality is assured at all other stages including showboard designing, upper making, counter moulding, lasting, midline passing, sole bonding, lacing, brushing and packaging. Other material like threads, rivets, eyelets and other embellishments are also tested for strength, colour fastness, etc.</p>\r\n</div>\r\n<div class="leather-img l-d-mob-view"><img alt="leather" class="img-responsive" src="images/leather.jpg" title="leather" /></div>\r\n\r\n\r\n<div class="container-fluid craftsmanship-area">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="note">\r\n<p><b>Note:</b></p>\r\n\r\n<p>Leather is a natural material, and we use chemicals for tanning within the prescribed limits. Therefore, it is highly unlikely that wearing our leather shoes (leather upper and leather lining) will cause an allergic reaction. Synthetic materials, on the other hand, are made of several chemicals and are more likely to cause allergic reactions. We do not use synthetic/faux leather in any of our products.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end of socity area-->', 1, 'Quality Control', 'Quality Control', 'Quality Control', '1462260589.jpg');
INSERT INTO `pages` (`id`, `name`, `slug`, `description`, `status`, `meta_keywords`, `meta_desc`, `meta_title`, `featured_image`) VALUES
(10, 'Privacy Policy', 'privacy-policy', '\r\n<div class="container-fluid craftsmanship-area brand-main">\r\n<section class="drish-story">\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="csr-text terms-condition">\r\n<h3><strong>What information do we collect?</strong></h3>\r\n\r\n<p>We collect information from you when you register, order on our site or fill out a form. When registering on our site, as appropriate, you may be asked to enter your name, e-mail address, mailing address, phone number. You may, however, visit our site anonymously.</p>\r\n</div>\r\n\r\n<div class="csr-text terms-condition">\r\n<h3><strong>How do we use your information?</strong></h3>\r\n\r\n<p>Any of the information we collect from you may be used in one of the following ways:-<br />\r\n1. To personalize your experience (your information helps us to better respond to your individual needs)<br />\r\n2. To send periodic emails<br />\r\nThe email address you provide will only be used to send you information and updates pertaining to your order.</p>\r\n</div>\r\n\r\n<div class="csr-text terms-condition">\r\n<h3><strong>How do we protect your information?</strong></h3>\r\n\r\n<p>We implement a variety of security measures to maintain the safety of your personal information when you submit, or access your personal information.</p>\r\n</div>\r\n\r\n<div class="csr-text terms-condition">\r\n<h3><strong>Do we use cookies?</strong></h3>\r\n\r\n<p>Yes (Cookies are small files that a site or its service provider transfers to your computers hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information. We may use Google as a third party vendor and its technology called Remarketing to show you advertisements for our Site when you visit other sites in the Google Display Network. It is done through the use of cookies (the "Advertising Cookies"). The sole use of these cookies is, as stated above, to simply show you advertisements for our site, they are not being used to track you in any other way. Please note that we do not link the information in the Advertising Cookies or any other cookie to your personal information. We use cookies to understand and save your preferences for future visits, keep track of advertisements and compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future. We may contract with third-party service providers to assist us in better understanding our site visitors. These service providers are not permitted to use the information collected on our behalf except to help us conduct and improve our business.</p>\r\n</div>\r\n\r\n<div class="csr-text terms-condition">\r\n<h3><strong>Controlling Your Privacy</strong></h3>\r\n\r\n<p>There are three simple ways in which you can opt-out from tracking by this website.<br />\r\n#1: You can control how your browser accepts cookies. This article: How to control cookies has simple instructions for Windows and Mac computers and Chrome, IE, AOL, Firefox, Opera and Safari browsers. You can now choose to accept first party or third party cookies (or neither).<br />\r\n#2: You can turn off JavaScript in your browser.<br />\r\n#3: You can also use Google Analytics opt-out browser add-on. to control the way cookies behave.</p>\r\n</div>\r\n\r\n<div class="csr-text terms-condition">\r\n<h3><strong>Do we disclose any information to outside parties?</strong></h3>\r\n\r\n<p>We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses. If you have any questions regarding our privacy policy, please contact us at support@drish.com. We will address any issue to the best of our capabilities.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</div>\r\n', 1, 'Privacy Policy', 'Privacy Policy', 'Privacy Policy', '1469435063.jpg'),
(11, 'Shipping & Returns', 'shipping-and-returns', '\r\n<div class="container-fluid craftsmanship-area terms-condition">\r\n<div class="csr-text terms-condition">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<h4><strong>SHIPPING:</strong></h4>\r\n\r\n<p>We offer free shipping all over India!<br />\r\nItems ordered will be delivered within 2 – 10 working days after order confirmation. We do not process orders on Sundays and on national holidays.<br />\r\nWe pack our products in our monogrammed courier bag. Before accepting delivery of any merchandise, please ensure that the packaging and invoice have not been damaged or tampered with. In case it is, please do not accept the parcel. Please click a photograph of the parcel and email it to us at <a href="mailto:support@drish.com">support@drish.com</a>.</p>\r\n\r\n<h4><strong>RETURNS:</strong></h4>\r\n\r\n<p>We try our best to provide you with the highest quality and correctly sized products. However, if, for some reason, you are not satisfied with your purchase, you can get it replaced or return it to us <strong>free of cost</strong>. The refund/exchange must be initiated within <strong>15 days</strong> of delivery of the merchandise. We won’t be able to process refund/exchange requests placed after 15 days from the date you receive your shipment.<br />\r\nWe offer&nbsp;<strong>free and easy returns/replacement</strong>&nbsp;through courier pickup.</p>\r\n\r\n<p><u>DEFECTIVE PRODUCTS</u></p>\r\n\r\n<p>In the unlikely event that any merchandise you have ordered from us is not received in good condition, is damaged or defective, or if merchandise delivered is different from what you had expected, you may return the merchandise unused, and in the same condition as you received it, in its original packaging along with original tags, for a refund or an exchange, within&nbsp;1<strong>5 days</strong>&nbsp;from the date on which these goods are delivered. We won’t be able to process refund/exchange requests for defective products if placed after 15 days from the date you receive your shipment.</p>\r\n\r\n<p><u>PROCESS FOR REFUND/EXCHANGE</u></p>\r\n\r\n<p>Refund/exchange must be initiated within <strong>15 days</strong> of delivery.</p>\r\n\r\n<p><strong><em><u>Option A</u></em></strong></p>\r\n\r\n<p><strong>STEP 1:</strong> Send an email to DRISH Customer Care team at – support@drish.com.<br />\r\nOR<br />\r\nCall DRISH Customer Care team at – toll free number 1800 137 0107 (Between 10:00 am to 6:00 pm from Monday to Saturday)<br />\r\n<strong>STEP 2:</strong> Give the following information to the Customer Care Associate:</p>\r\n\r\n<ul class="name-shipping">\r\n	<li>Your Name</li>\r\n	<li>Order Number</li>\r\n	<li>Reason for return/exchange</li>\r\n</ul>\r\n<br />\r\n<p>In case of exchange, the new product you want to place an order for (Customer Care Associate will let you know whether the item is in stock or not).<p>\r\n\r\n\r\n<p><strong>STEP 3:</strong> DRISH Customer Care team will process your return/exchange request, and will let you know the date and time when the goods will be picked up from your shipping address.<br />\r\n<br />\r\n<strong>STEP 4:</strong> At the time of collection of the merchandise, you will be given a courier receipt, which is to be retained for future reference. Please also keep a copy of the sales invoice for future reference, before handing over the return merchandise and original sales invoice to the courier.<br />\r\n<br />\r\n<strong>STEP 5:</strong> DRISH Customer Care team will inspect the merchandise returned to ensure that it is in the original packing and unused condition, along with the original labels, tags and invoice, <strong>failing which refund/exchange may not be possible.</strong> If the merchandise, packaging, tags and labels and invoice are in order then a refund will be processed within 15 working days from the date of receipt of the merchandise.</p>\r\n\r\n<p>*Any refund against a return request made to DRISH Customer Care, and collected by courier from the shipping address where the item was originally delivered, shall be processed only upon receipt of the merchandise in unused condition, along with the original sales invoice.</p>\r\n\r\n<p><strong><em><u>Option B</u></em></strong></p>\r\n\r\n<p><strong>STEP 1:</strong> Open the URL <a href="http://www.drish.com/">www.drish.com</a><br />\r\n<br />\r\n<strong>STEP 2:</strong> Click on the ‘Login’ link at the top-left corner of the page, and log in to your account on the website.<br />\r\n<br />\r\n<strong>STEP 3:</strong> Go to your ‘Account’ page and click on ‘Order Detail’ option in the left-side menu.<br />\r\n<br />\r\n<strong>STEP 4:</strong> Click on ‘Return/Exchange’ link &nbsp;on the orders page to&nbsp;submit your request.<br />\r\n<br />\r\n<strong>STEP 5:</strong> DRISH team will process your refund/exchange process, and you will be notified about the date and time when the merchandise to be returned will be picked up from the shipping address.<br />\r\n<strong>STEP 6:</strong> At the time of collection of the merchandise, you will be given a courier receipt, which is to be retained for future reference. Please also keep a copy of the sales invoice for future reference, before handing over the return merchandise and original sales invoice to the courier.<br />\r\n<br />\r\n<strong>STEP 7:</strong> DRISH Customer Care team will inspect the merchandise returned to ensure that it is in the original packing and unused condition, along with the original labels, tags and invoice, <strong>failing which refund/exchange may not be possible. </strong>If the merchandise, packaging, tags and labels and invoice are in order then a refund will be processed within 15 working days from the date of receipt of the merchandise.<br />\r\n*Any refund against a return request made on www.drish.com, and collected by courier from the delivery address where the item was originally delivered, shall be processed only upon receipt of the merchandise in unused condition, along with the original sales invoice.</p>\r\n\r\n<p><u>PACKING INSTRUCTIONS</u></p>\r\n\r\n<p>While handing over your merchandise to the courier company associate for return, you need to ensure that the merchandise is securely packed, so that it reaches us in good condition.</p>\r\n\r\n<p>STEP 1: Put your merchandise, tags and original invoice in the box it was delivered in.</p>\r\n\r\n<p>STEP 2: Put the box in a polybag and seal it adequately with duct tape.</p>\r\n\r\n<p><strong><em>To make things fair for all of us and provide you with the benefits of the Return Policy, we adhere to below mention points:</em></strong></p>\r\n\r\n<p>All items to be returned must be unworn, unused and in their original condition. The original labels, tags and packaging should be intact and untampered with.<br />\r\nWe expect that while returning the product you will pack the merchandise very safely and securely. We won''t be able to entertain any refund/exchange for the shoe damaged in transit because of insecure packing while being returned.</p>\r\n\r\n<p>*Any disputes arising regarding products, return, refund and exchange shall be subject to the jurisdiction of Haryana Court only.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 1, 'Shipping Policy and Return Policy', 'Shipping Policy and Return Policy', 'Shipping and Returns Policy', '1469435220.jpg'),
(12, 'FAQs', 'faqs', '<div class="container-fluid craftsmanship-area brand-main">\r\n<section class="drish-story">\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="csr-text">&nbsp;</div>\r\n\r\n<div class="csr-text">COMING SOON</div>\r\n</div>\r\n</div>\r\n</section>\r\n</div>\r\n', 1, 'Frequently Asked Questions', 'Frequently Asked Questions', 'Frequently Asked Questions', '1469526552.jpg'),
(13, 'Terms & Conditions', 'terms-and-conditions', '<div class="container-fluid craftsmanship-area brand-main">\r\n<section class="drish-story">\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="csr-text terms-condition">\r\n<p>The Terms and Conditions contained herein shall apply to any person (“User”) using the services of Drish for making invoice payments through an online payment gateway service (“Service”) offered jointly by ICICI Bank Ltd. and Payment Gateway Service provider, through Drish''s website i.e. wwww.drish.com Each User is therefore deemed to have read and accepted these Terms and Conditions.</p>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><strong>A. Privacy Policy<strong> </strong></strong></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;">Drish respects and protects the privacy of the individuals that access the information and use the services provided through them. Individually identifiable information about the User is not willfully disclosed to any third party without first receiving the User’s permission, as covered in this Privacy Policy. This Privacy Policy describes Drish’s treatment of personally identifiable information that Drish collects when User is on Drish’s website. Drish does not collect any unique information about the User (such as User’s name, email address, age, gender etc.) except when the User specifically and knowingly provide such information on the Website. Like any business interested in offering the highest quality of service to clients, Drish may, from time to time, send email and other communication to the User tell them about the various services, features, functionality and content offered by Drish website or seek voluntary information from you.</div>\r\n\r\n<div style="text-align: justify;">Please be aware, however, that Drish will release specific personal information about the User if required to do so in the following cirumstances:</div>\r\n\r\n<div style="text-align: justify;">a) in order to comply with any valid legal process such as a search warrant, statute, or court order, or</div>\r\n\r\n<div style="text-align: justify;">b) if any of User’s actions on Drish’s website violate the Terms of Service or any of Drish’s guidelines for specific services, or</div>\r\n\r\n<div style="text-align: justify;">c) to protect or defend Drish’s legal rights or property, the Drish site, or Drish Users; or</div>\r\n\r\n<div style="text-align: justify;">d) to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the security, integrity of Drish website/offerings.</div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><strong><strong>B. General Terms and Conditions For Online-Payments </strong></strong></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;">1. Once a User has accepted these Terms and Conditions, he/ she may register and avail the Services. A User may either register on Drish’s website or alternatively make payment in any other manner as may be specified by Drish from time to time.</div>\r\n\r\n<div style="text-align: justify;">2. Drish''s rights, obligations, undertakings shall be subject to the laws in force in India, as well as any directives/ procedures of Government of India, and nothing contained in these Terms and Conditions shall be in derogation of Drish''s right to comply with any law enforcement agencies request or requirements relating to any User’s use of the website or information provided to or gathered by Drish with respect to such use. Each User accepts and agrees that the provision of details of his/ her use of the Website to regulators or police or to any other third party in order to resolve disputes or complaints which relate to the Website shall be at the absolute discretion of Drish.</div>\r\n\r\n<div style="text-align: justify;">3. If any part of these Terms and Conditions are determined to be invalid or unenforceable pursuant to applicable law including, but not limited to, the warranty disclaimers and liability limitations set forth herein, then the invalid or unenforceable provision will be deemed superseded by a valid, enforceable provision that most closely matches the intent of the original provision and the remainder of these Terms and Conditions shall continue in effect.</div>\r\n\r\n<div style="text-align: justify;">4. These Terms and Conditions constitute the entire agreement between the User and Drish. These Terms and Conditions supersede all prior or contemporaneous communications and proposals, whether electronic, oral, or written, between the User and Drish. A printed version of these Terms and Conditions and of any notice given in electronic form shall be admissible in judicial or administrative proceedings based upon or relating to these Terms and Conditions to the same extent and subject to the same conditions as other business documents and records originally generated and maintained in printed form.</div>\r\n\r\n<div style="text-align: justify;">5. The entries in the books of Drish and/or the Payment Service Providers kept in the ordinary course of business of Drish and/or the Payment Service Providers with regard to transactions covered under these Terms and Conditions and matters therein appearing shall be binding on the User and shall be conclusive proof of the genuineness and accuracy of the transaction.</div>\r\n\r\n<div style="text-align: justify;">6. Refund For Charge Back Transaction: In the event there is any claim for/ of charge back by the User for any reason whatsoever, such User shall immediately approach Drish with his/ her claim details and claim refund from Drish alone. Such refund (if any) shall be effected only by Drish via payment gateway or by means of a demand draft or such other means as Drish deems appropriate. No claims for refund/ charge back shall be made by any User to the Payment Service Provider(s) and in the event such claim is made it shall not be entertained.</div>\r\n\r\n<div style="text-align: justify;">7. In these Terms and Conditions, the term “Charge Back” shall mean, approved and settled credit card or net banking purchase transaction(s) which are at any time refused, debited or charged back to merchant account (and shall also include similar debits to Payment Service Provider''s accounts, if any) by the acquiring bank or credit card company for any reason whatsoever, together with the bank fees, penalties and other charges incidental thereto.</div>\r\n\r\n<div style="text-align: justify;">8. Refund for fraudulent/duplicate transaction(s): The User shall directly contact Drish for any fraudulent transaction(s) on account of misuse of Card/ Bank details by a fraudulent individual/party and such issues shall be suitably addressed by Drish alone in line with their policies and rules.</div>\r\n\r\n<div style="text-align: justify;">9. Server Slow Down/Session Timeout: In case the Website or Payment Service Provider’s webpage, that is linked to the Website, is experiencing any server related issues like ‘slow down’ or ‘failure’ or ‘session timeout’, the User shall, before initiating the second payment,, check whether his/her Bank Account has been debited or not and accordingly resort to one of the following options:</div>\r\n\r\n<div style="text-align: justify;">(I) In case the Bank Account appears to be debited, ensure that he/ she does not make the payment twice and immediately thereafter contact Drish via e-mail or any other mode of contact as provided by Drish to confirm payment.</div>\r\n\r\n<div style="text-align: justify;">(ii)n case the Bank Account is not debited, the User may initiate a fresh transaction to make payment.</div>\r\n\r\n<div style="text-align: justify;">However, the User agrees that under no circumstances the Payment Gateway Service Provider shall be held responsible for such fraudulent/duplicate transactions and hence no claims should be raised to Payment Gateway Service Provider No communication received by the Payment Service Provider(s) in this regards shall be entertained by the Payment Service Provider(s).</div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><strong><strong>C. Limitation of Liability </strong></strong></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;">1. Drish has made this Service available to the User as a matter of convenience. Drish expressly disclaims any claim or liability arising out of the provision of this Service. The User agrees and acknowledges that he/ she shall be solely responsible for his/ her conduct and that <short any="" client="" else="" form="" full="" if="" name="" of="" the=""> reserves the right to terminate the rights to use of the Service immediately without giving any prior notice thereof. </short></div>\r\n\r\n<div style="text-align: justify;">2. Drish and/or the Payment Service Providers shall not be liable for any inaccuracy, error or delay in, or omission of</div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">(a) any data, information or message, or </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">(b) the transmission or delivery of any such data, information or message; or </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">(c) any loss or damage arising from or occasioned by any such inaccuracy, error, delay or omission, non-performance or interruption in any such data, information or message. Under no circumstances shall the Drish and/or the Payment Service Providers, its employees, directors, and its third party agents involved in processing, delivering or managing the Services, be liable for any direct, indirect, incidental, special or consequential damages, or any damages whatsoever, including punitive or exemplary arising out of or in any way connected with the provision of or any inadequacy or deficiency in the provision of the Services or resulting from unauthorized access or alteration of transmissions of data or arising from suspension or termination of the Services. </short></div>\r\n\r\n<div style="text-align: justify;">3. Drish and the Payment Service Provider(s) assume no liability whatsoever for any monetary or other damage suffered by the User on account of:</div>\r\n\r\n<div style="text-align: justify;">(I) the delay, failure, interruption, or corruption of any data or other information transmitted in connection with use of the Payment Gateway or Services in connection thereto; and/ or</div>\r\n\r\n<div style="text-align: justify;">(ii) any interruption or errors in the operation of the Payment Gateway.</div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">4. The User shall indemnify and hold harmless the Payment Service Provider(s) and Drish and their respective officers, directors, agents, and employees, from any claim or demand, or actions arising out of or in connection with the utilization of the Services. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">5. The User agrees that Drish or any of its employees will not be held liable by the User for any loss or damages arising from your use of, or reliance upon the information contained on the Website, or any failure to comply with these Terms and Conditions where such failure is due to circumstance beyond Drish’s reasonable control. </short></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the=""><strong>D. Miscellaneous Conditions : </strong></short></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">1. Any waiver of any rights available to Drish under these Terms and Conditions shall not mean that those rights are automatically waived. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">2. The User agrees, understands and confirms that his/ her personal data including without limitation details relating to debit card/ credit card transmitted over the Internet may be susceptible to misuse, hacking, theft and/ or fraud and that Drish or the Payment Service Provider(s) have no control over such matters. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">3. Although all reasonable care has been taken towards guarding against unauthorized use of any information transmitted by the User, Drish does not represent or guarantee that the use of the Services provided by/ through it will not result in theft and/or unauthorized use of data over the Internet. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">4</short><short any="" client="" else="" form="" full="" if="" name="" of="" the="">. Drish, the Payment Service Provider(s) and its affiliates and associates shall not be liable, at any time, for any failure of performance, error, omission, interruption, deletion, defect, delay in operation or transmission, computer virus, communications line failure, theft or destruction or unauthorized access to, alteration of, or use of information contained on the Website. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">5. The User may be required to create his/ her own User ID and Password in order to register and/ or use the Services provided by Drish on the Website. By accepting these Terms and Conditions the User aggress that his/ her User ID and Password are very important pieces of information and it shall be the User’s own responsibility to keep them secure and confidential. In furtherance hereof, the User agrees to; </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">i. Choose a new password, whenever required for security reasons. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">ii. Keep his/ her User ID &amp; Password strictly confidential. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">iii. Be responsible for any transactions made by User under such User ID and Password. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">The User is hereby informed that Drish will never ask the User for the User’s password in an unsolicited phone call or in an unsolicited email. The User is hereby required to sign out of his/ her Drish account on the Website and close the web browser window when the transaction(s) have been completed. This is to ensure that others cannot access the User’s personal information and correspondence when the User happens to share a computer with someone else or is using a computer in a public place like a library or Internet café. </short></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><strong><strong><short any="" client="" else="" form="" full="" if="" name="" of="" the="">E. Debit/Credit Card, Bank Account Details </short></strong></strong></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">1. The User agrees that the debit/credit card details provided by him/ her for use of the aforesaid Service(s) must be correct and accurate and that the User shall not use a debit/ credit card, that is not lawfully owned by him/ her or the use of which is not authorized by the lawful owner thereof. The User further agrees and undertakes to provide correct and valid debit/credit card details. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">2. The User may pay his/ her dues to Drish by using a debit/credit card or through online banking account. The User warrants, agrees and confirms that when he/ she initiates a payment transaction and/or issues an online payment instruction and provides his/ her card / bank details: </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">i. The User is fully and lawfully entitled to use such credit / debit card, bank account for such transactions; </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">ii. The User is responsible to ensure that the card/ bank account details provided by him/ her are accurate; </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">iii. The User is authorizing debit of the nominated card/ bank account for the payment of dues selected by such User along with the applicable Fees. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">iv. The User is responsible to ensure sufficient credit is available on the nominated card/ bank account at the time of making the payment to permit the payment of the dues payable or the bill(s) selected by the User inclusive of the applicable Fee. </short></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the=""><strong>F. Personal Information </strong></short></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">1. The User agrees that, to the extent required or permitted by law, Drish and/ or the Payment Service Provider(s) may also collect, use and disclose personal information in connection with security related or law enforcement investigations or in the course of cooperating with authorities or complying with legal requirements. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">2. The User agrees that any communication sent by the User vide e-mail, shall imply release of information therein/ therewith to Drish. The User agrees to be contacted via e-mail on such mails initiated by him/ her. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">3. In addition to the information already in the possession of Drish and/ or the Payment Service Provider(s), Drish may have collected similar information from the User in the past. By entering the Website the User consents to the terms of Drish’s information privacy policy and to Drish’s continued use of previously collected information. By submitting the User’s personal information to Drish, the User will be treated as having given his/her permission for the processing of the User’s personal data as set out herein. </short></div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">4. The User acknowledges and agrees that his/ her information will be managed in accordance with the laws for the time in force. </short></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><strong><strong><short any="" client="" else="" form="" full="" if="" name="" of="" the="">G. Payment Gateway Disclaimer </short></strong></strong></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;"><short any="" client="" else="" form="" full="" if="" name="" of="" the="">The Service is provided in order to facilitate access to view and pay dues online. Drish or the Payment Service Provider(s) do not make any representation of any kind, express or implied, as to the operation of the Payment Gateway other than what is specified in the Website for this purpose. By accepting/ agreeing to these Terms and Conditions, the User expressly agrees that his/ her use of the aforesaid online payment Service is entirely at own risk and responsibility of the User. </short></div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;">E. Any disputes shall be subject to the jurisdiction of Haryana Court only.</div>\r\n\r\n<div style="text-align: justify;">&nbsp;</div>\r\n\r\n<div style="text-align: justify;">F. All our risks and responsibilities cease as soon as the goods are delivered to the Customer.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</div>\r\n', 1, 'Terms and Conditions', 'Terms and Conditions', 'Terms and Conditions', '1469527145.jpg'),
(14, 'USPs', 'brand-usp', '<div class="container-fluid craftsmanship-area brand-main">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="drish-global">\r\n<h3>COMFORT</h3>\r\n\r\n<p>We understand that comfort of a shoe is not merely a physical condition but a psychological state of mind, wherein the customer feels an ease and a state of pleasure. Comfort of a shoe depends upon the effect of the shape of the shoe, materials used in the shoe and the attention given by the manufacturer to the sacred tenets of sound shoemaking. At Drish, our priority is to provide our customers the best of comfort features in fashionable and stylish footwear. Comfort not only means acceptability but also ensures us repeat purchases translating into brand loyalty.</p>\r\n</div>\r\n</div>\r\n\r\n<section class="drish-story">\r\n<div class="container-fluid">\r\n<div class="row">\r\n<div class="col-lg-7 col-md-7 col-sm-12 col-xs-12">\r\n<h3>Fit</h3>\r\n\r\n<p>We understand all the attributes of a feet. Our fit is not derived from “all-feet-fit-general sizes” school of thinking. Two people might have feet of the same length, but other foot measurements like girth, width, instep girth, arch height etc. might differ.All these factors must be given equivalent importance as they all contribute to the comfort of the shoe.</p>\r\n\r\n<p>Through our research and foot surveys, we have conclusively established that Indians have some of the widest feet per unit centimetre of length in the world. Therefore, we offer more than one width for every size (above EU 32) for the benefit of the Indian customer. We have styles in G, H, K and M widths, and certain styles are available in two widths as well.(Survey has been mentioned under the foot surveys heading ) Though companies provide more than one width for a size in Europe, this is exclusively made available in India by Drish. There is a lack of awareness among the Indian customer about the foot size . This can lead to general discomfort and tripping while walking.</p>\r\n\r\n<p>Our comprehensive knowledge of feet and footwear enables us to achieve widest range of fits over the largest number of models and sizes. This earns us brand distinction.</p>\r\n</div>\r\n\r\n<div class="col-lg-5 col-md-5 col-sm-12 col-xs-12">\r\n<div class="drish-story-img"><img alt="craftsmanship" class="img-responsive" drish-global="" src="/uploads/ckeditor/main/1469795820_USPS - 1.jpg" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class="drish-story">\r\n<div class="container-fluid">\r\n<div class="row">\r\n<div class="col-lg-5 col-md-5 col-sm-12 col-xs-12">\r\n<div class="drish-story-img"><img alt="craftsmanship" class="img-responsive" drish-global="" src="/uploads/ckeditor/main/1469517606_craftsmanship.jpg" /></div>\r\n</div>\r\n\r\n<div class="col-lg-7 col-md-7 col-sm-12 col-xs-12">\r\n<h3>Customization</h3>\r\n\r\n<p>We understand customization as the art of stretching our skills and expertise to cater to individual specifications and preferences at every commission. We offer two kinds of footwear customization, depending upon the need of our customers.</p>\r\n\r\n<p>The first is the customization of look, style and aesthetics (shoes made to order). We custom design a shoe according to the customer’s choice.They are subject to the choices given in the catalogue available in our store</p>\r\n\r\n<p>The second is the customization of fit (Bespoke shoes or shoes made to measure). Often we come across situations when a customer cannot find shoes that fit him/her perfectly, due to their feet being too narrow or too wide. In this case the customer’s feet are measured by our experts using a 3D foot scanning machine as well as physical measurement (to be doubly sure!).This is how we do Bespoke shoes.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</div>\r\n</div>\r\n', 1, 'Brand USPs', 'Brand USPs', 'Brand USPs', '1469520455.jpg'),
(15, 'Size Chart', 'size-chart', '<div class="size-finder-bg">\r\n<div class="container-fluid">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<ul class="sizechart-img">\r\n	<li><img alt="fine-pencil" class="img-responsive" src="images/sizechart/Adult-shoes.jpg" title="fine-pencil" /></li>\r\n	<li><img alt="fine-pencil" class="img-responsive" src="images/sizechart/Boys-shoes.jpg" title="fine-pencil" /></li>\r\n	<li><img alt="fine-pencil" class="img-responsive" src="images/sizechart/Girls-shoes.jpg" title="fine-pencil" /></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 1, 'Size Chart', 'Size Chart', 'Size Chart', '1469524416.jpg'),
(16, 'Foot Survey', 'foot-survey', '<div class="container-fluid craftsmanship-area brand-main">\r\n<section class="drish-story">\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<p><strong><u>Foot survey</u></strong><br />\r\nAs premium leather shoes manufacturers, it has always been our endeavour to understand the ‘feet’ and design footwear accordingly. As part of this wider ‘understanding’ we embarked on an extensive foot survey of children, which ultimately led to some insightful findings.&nbsp; Our survey was a step further from another such foot survey done by the Austrian government between 2001 and 2007.<br />\r\n<br />\r\n<strong>We addressed two key issues:</strong><br />\r\na)&nbsp;&nbsp;&nbsp; For a given length, what is the girth of the child’s foot? Or conversely, is the child’s foot also comparatively ‘wide’ as in the case of an average Indian adult?<br />\r\nb)&nbsp;&nbsp; Analysis of defects visible in children being surveyed.<br />\r\n<strong>Methodology</strong><br />\r\n1. We surveyed a sample of 1225 children taken across from various age groups and segments of society in the north region.<br />\r\n2. Children surveyed were between 1.5 and 15 years of age.<br />\r\n3.&nbsp; We used a size chart based on the standard length and girth measurements followed in Europe. In children with shoe sizes up to EU size 31, the size chart dimensions were adequate to cover the different lengths and girths of children’s feet. However, for at least 53% of the children having size 32-39, the girths were beyond the normal girth in the chart while the lengths were as per the size chart. In some cases, the deviation from normal girth was as much as 22 mm.<br />\r\n<br />\r\n<strong>Findings/results</strong><br />\r\n1. Our survey revealed that foot girths were found to widen after a specific age in both boys and girls. In boys, the feet were seen to widen around the age of 5 while in girls this age was 6.<br />\r\n2.&nbsp; The foot girths were found to widen after a specific age in both boys and girls. In boys, the feet were seen to widen around the age of 5 while in girls this age was 6.<br />\r\n3. We made some interesting observations regarding the socks.&nbsp; Socks as well as the shoes kids wore at school (where they spend a large part of their day) were of synthetic material which did not absorb sweat, thus giving the children sweaty and smelly feet. Also most children’s socks were too big for their feet, which results in wrinkling of the socks within the shoe, thus creating shear pressure points. Depending on the size of the wrinkle and its location, the shoe possibly felt 1 to 2 sizes short.</p>\r\n\r\n<p><strong>Survey effects</strong></p>\r\n\r\n<p>From the survey it is clear that we needed footwear to accommodate higher than ‘normal’ widths also. So, we have decided to carry two widths as of now. One is ‘normal’ and the second is ‘wide’. The latter is 10 mm more girth than ‘normal’ in case of girls and 13 mm more girth than ‘normal’ in case of boys.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</section>\r\n</div>\r\n', 1, 'Foot Survey', 'Foot Survey', 'Foot Survey', '1469525502.jpg'),
(17, 'Parents'' Guide', 'parents-guide', '<div class="container-fluid craftsmanship-area brand-main">\r\n<div class="parent-guide">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="parent-banner">\r\n<div class="parents-text">\r\n<h2>Parents’ Guide for the <span>right footwear of kids</span></h2>\r\n\r\n<p>Children, especially infants, are short on expression. They can’t express discomfort, they can’t assess the size of the shoeand they least know the consequences of wearing wrong sizes. Parents who squeeze their child’s feet into the wrong-sized shoes could be condemning them to a lifetime of problems.</p>\r\n\r\n<p>We have reached some conclusions regarding children footwear based on well researched information, probes into worldwide podiatric research, R&amp;D activity and our own extensive foot surveys.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="pointer-for-parents">\r\n<div class="row">\r\n<div class="col-lg-7 col-md-7 col-sm-7 col-xs-12">\r\n<div class="pointer-text">\r\n<h3>Below are a few pointers for parents:</h3>\r\n\r\n<p>1. Most of the foot problems like hallux valgus, bunions, in-growing toe nails, verrucai, hammer toes and foot pain that adults encounter have the roots in wrong choice of footwear during childhood.</p>\r\n\r\n<p>2. Kids’ feet undergo up to three times the stress than an adult foot because children have much higher activity levels than adults.</p>\r\n\r\n<p>3. Too large shoes are just as bad for children as the short ones. Shoes that are too small hinder foot growth and decrease circulation besides hurting. Shoes that are too big can cause uncomfortable chafing or blisters, and also fail to hold on to the child’s foot properly when running or climbing, causing the child to trip and fall.</p>\r\n\r\n<p>4. It too has been observed that most foot defects were reversed in quite a few cases when children with foot defects (caused by incorrect footwear) were made to wear proper footwear under supervision.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-5 col-md-6 col-sm-6 col-xs-12">\r\n<div class="shoe-net-w"><img alt="woman-shoe" class="img-responsive" src="images/shoes-step.jpg" title="woman-shoe" /></div>\r\n</div>\r\n\r\n<div class="col-lg-7 col-md-6 col-sm-6 col-xs-12">\r\n<div class="observed">\r\n<p>5. It has been observed that 90% of the children could not tell they were wearing short shoes. This is because children’s feet are all cartilage and soft bones that can easily be bended and squeezed, so a child does not feel the pressure and constriction of a short shoe. Therefore, the responsibility of determining the correct size and fit of children’s shoes lies with the parents.</p>\r\n\r\n<p>6. Normally, children’s feet grow 2 sizes per year from 1-3 years, one and a half sizes per year from 4 to 6 years and then one size per year thereafter. Hence, for children between 1-3 years, foot measurements should be taken between 4 to 6 months; for ages between 4 to 6 years and beyond, every 6 to 8 months because the child’s foot also grows in spurts.</p>\r\n\r\n<p>7. To be comfortable, shoes must have good shock absorption ability and adequate cushioning, good flexibility, be light weight, have firm front and back parts. The shoe must always be firm at the toe and the back to give protection while running and playing.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-7 col-md-7 col-sm-6 col-xs-12">\r\n<div class="observed">\r\n<p>8. The shoes must also have enough depth at the front to allow free movement of toes and support to the feet. They should be made of only permeable and breathable material which is leather. Leather gives the added benefit of adjusting to the child’s growing foot by gradually expanding and accommodating the sudden foot growth. On the other hand, materials like canvas and all synthetic materials</p>\r\n\r\n<p>9. Regular inspection of child’s feet should be done to check occurrence of inflamed nails and red pressure marks on joints of the toes, ankle and heel.</p>\r\n\r\n<p>10. Children should be made to wear socks that are made only of natural materials like cotton. Socks should be of right size as well. Socks that are too big can ruin the comfort of a correctly fitted shoe.</p>\r\n\r\n<p>11. Toe nails must be trimmed regularly. While cutting nails, be careful not to cut them too short or to cut down the side of the nails.</p>\r\n</div>\r\n</div>\r\n\r\n<div class="col-lg-5 col-md-5 col-sm-6 col-xs-12">\r\n<div class="woman-enjoing"><img alt="dotted-net" class="img-responsive" src="images/women-size.jpg" title="dotted-net" /></div>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-lg-4 col-md-5 col-sm-6 col-xs-12">\r\n<div class="select-shoes"><img alt="net-bg-shoe" class="img-responsive" src="images/net-bg-shoes.jpg" title="net-bg-shoes" /></div>\r\n</div>\r\n\r\n<div class="col-lg-8 col-md-7 col-sm-6 col-xs-12">\r\n<div class="help-hand">\r\n<h2>Help at hand from<span>Drish</span></h2>\r\n\r\n<p>Given the paramount importance of fit, we started a research project in the summer of 2015 to devise shoe sizing methods that would enable any parent anywhere in the world to accurately determine the length and the girth of the child’s foot. We call this innovative sizing method <span>RevosizeTM</span> and the <span>‘Accu Foot Size’</span> app is an integral part of it. This unique sizing method is described in a separate section.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n', 1, 'Parents'' Guide', 'Parents'' Guide', 'Parents'' Guide', '1469525007.jpg'),
(18, 'Store Locator', 'store-locator', '<div class="container-fluid craftsmanship-area quality-outer">\r\n<section class="drish-story">\r\n<div class="row">\r\n<div class="col-xs-12">\r\n<div class="store-locator">\r\n<div class="contact-info">\r\n<div class="col-lg-4 col-md-4 col-sm-4 col-xs-12">Shop No. 244, Elante Mall Second Floor.<br />\r\n<a href="mailto:drishelantechd@drish.com">drishelantechd@drish.com</a> <a href="tel:+911725011726">+91 172 5011726</a></div>\r\n\r\n<div class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\r\n<div class="contact-map"><iframe allowfullscreen="" frameborder="0" height="500" src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3430.4556663583808!2d76.79896121582776!3d30.705587981646683!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x390fece98c02452b%3A0xf3c99c507c9226eb!2sElante+Mall%2C+178-178A%2C+Purv+Marg%2C+Industrial+Area+Phase+I%2C+Chandigarh%2C+160002!5e0!3m2!1sen!2sin!4v1464858853783" style="border:0"></iframe></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n</div>\r\n', 1, '', '', '', '1469682907.jpg');
