r\n			<li><a href="http://drish.com/category/women/women-shopbycollection/women-cool-casuals.html">Cool Casuals</a></li>\r\n			<li><a href="http://drish.com/category/women/women-shopbycollection/women-straps-and-buckles.html">Straps &amp; Buckles</a></li>\r\n			<li><a href="http://drish.com/category/women/women-shopbycollection/women-elegant-comfort.html">Elegant Comfort</a></li>\r\n			<li><a href="http://drish.com/category/women/women-shopbycollection/women-party-shoes.html">Party Shoes</a></li>\r\n			<li><a href="http://drish.com/category/women/women-shopbycollection/women-smart-casuals.html">Smart Casuals</a></li>\r\n		</ul>\r\n		</li>\r\n		<li><a href="http://drish.com/category/women/women-bags.html">Bags</a></li>\r\n		<li><a href="http://drish.com/category/women/women-accessories.html">Accessories</a></li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>\r\n		<h2>ADVICE</h2>\r\n		</li>\r\n		<li><a href="http://drish.com/revosize.html">RevoSize(TM)</a></li>\r\n		<li><a href="http://drish.com/size-chart.html">Size Chart</a></li>\r\n		<li><a href="http://drish.com/parents-guide.html">Parents'' Guide</a></li>\r\n		<li><a href="http://drish.com/foot-survey.html">Foot Survey</a></li>\r\n		<li><a href="http://drish.com/why-leather.html">Why Leather?</a></li>\r\n		<li><a href="http://drish.com/shoe-care.html">Shoe Care</a></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ul class="col-lg-4 col-md-4 col-sm-4 col-xs-12">\r\n	<li>\r\n	<h2><a href="http://drish.com/category/kids.html">Children</a></h2>\r\n\r\n	<ul>\r\n		<li><a href="http://drish.com/category/kids/infant-shoes.html">Infants</a></li>\r\n		<li><a href="http://drish.com/category/kids/toddlers-shoes.html">Toddlers</a></li>\r\n		<li><a href="http://drish.com/category/kids/kids-girls-shoes.html">Girls</a></li>\r\n		<li><a href="http://drish.com/category/kids/kids-boys-shoes.html">Boys</a></li>\r\n		<li><a href="http://drish.com/category/kids/kids-school-shoes.html">School Shoes</a></li>\r\n	</ul>\r\n	</li>\r\n	<li><a href="http://drish.com/forum/" title="Drish Forum">Drish Forum </a></li>\r\n	<li><a href="http://drish.com/testimonial.html" title="Testimonial">Testimonial </a></li>\r\n	<li><a href="http://drish.com/account/mywishlist" title="Wishlist">Wishlist </a></li>\r\n	<li><a href="http://drish.com/account/orders.html" title="Orders">Orders </a></li>\r\n	<li><a href="http://drish.com/cart/cart" title="My Cart">My Cart</a></li>\r\n	<li><a href="http://drish.com/account.html" title="Account">My Account</a></li>\r\n	<li>\r\n	<ul>\r\n		<li>\r\n		<h2>HELP</h2>\r\n		</li>\r\n		<li><a href="http://drish.com/shipping-and-returns.html">Shipping &amp; Returns</a></li>\r\n		<li><a href="http://drish.com/faqs.html">FAQs</a></li>\r\n		<li><a href="http://drish.com/privacy-policy.html">Privacy Policy</a></li>\r\n		<li><a href="http://drish.com/terms-and-conditions.html">Terms &amp; Conditions</a></li>\r\n		<li><a href="http://drish.com/sitemap.html">Site Map</a></li>\r\n		<li><a href="http://drish.com/store-locator.html">Store Locator</a></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n</div>\r\n', 1, 'Drish Sitemap', 'Drish Sitemap', 'Drish Sitemap', '1470482436.jpg'),
(20, 'Chairman''s Message', 'chairmans-message', '<div class="container-fluid craftsmanship-area brand-main">\r\n<div class="row">\r\n<div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<p>Dear Parent,</p>\r\n\r\n<p>Please grant me two minutes of your time.</p>\r\n\r\n<p>American National Consumer Council Paper ‘Bad fit, Bad feet’ stated “.....The child who wears shoes and socks that fit badly is risking his health as surely as the child who eats too many sweets or starts to smoke. Although nearly every baby is born with healthy feet, it is estimated that the vast majority of adults in this country has a foot abnormality of some kind – corns, callouses, bunions or worse; and medical opinion is unanimous that the link between those healthy infant feet and the misshapen and painful deformities of adulthood is forged in childhood.”</p>\r\n\r\n<p>The foot is deeply integrated in the body system with the ankle, the knee, the hip and the spine. Any foot abnormality could have an effect further up the body. The foot is the very foundation of the body. A problem here is similar to the way that poor foundations can cause general structural problems and instability to a house.</p>\r\n\r\n<p>It is for 80 years now that Podiatrists in US and Europe have been steadfastly recommending that children shoes should be made only from natural materials, most particularly leather.</p>\r\n\r\n<p>Also consider that a country like UK with a population of 64 million has more than 20,000 Podiatrists. We have almost none.</p>\r\n\r\n<p>There is no organised effort in our country that takes scientifically made shoes to our children’s feet. We would do everything at our command to bridge that gap.</p>\r\n\r\n<p>We bring to every discerning, caring and aware parent leather shoes for the healthy and near natural growth of the feet of your child. We hope these well fitting all leather shoes into which 23 years experience of working with top European children shoe brands has been distilled, would make you feel the absence of organised podiatry less acutely. Our path breaking innovation in sizing and best manufacturing practices bring to you some of the finest children shoes in the world at Indian prices.</p>\r\n\r\n<p>We would strive with all our heart to approach inform, serve and engage with you for the comfort and health of your child and overall benefit to the society.</p>\r\n\r\n<p>By also building an on-line community we would initiate the dual principles of social benefit and social proof.<br />\r\nYour advocacy of this concept is the Holy Grail on which this entire effort is based.<br />\r\nFor the benefit of your child I urge you to explore this site further.</p>\r\n\r\n<p>With warm regards,</p>\r\n\r\n<p>(I. S. Paul)</p>\r\n\r\n<p>Chairman</p>\r\n</div>\r\n</div>\r\n</div>\r\n', 0, '', '', '', '1470750080.jpg');
