(203, 'Pebble Print Bracelet', NULL, 1, '650.00', '650.00', '<p>A genuine leather wrist-band that is funky yet classy. The 2-tone pebble print on calf leather adds interest to the otherwise clean an dsimple deisgn.</p>\r\n', '', 1, 0, 1, 0, 1470053561, 1472459238, '', '', '', 'DBWSS76034', 'N;', NULL, 'N;', 0, '76034-red-bracelet-girls', 0),
(204, 'Extra Length Wrap around Bracelet', NULL, 1, '750.00', '750.00', 'Extra Length Wrap around Bracelet', '', 1, 1, 1, 0, 1470053562, 1470053562, '', '', '', 'DBWSS76035', '', NULL, '', 0, '204', 0),
(206, 'Peep Toe Flats', NULL, 1, '3200.00', '3200.00', '<p>These genuine leather flat peep-toe sandals are stylish and fun. Pair them with a dress or skirt for a fresh look.</p>\r\n', '', 1, 0, 1, 0, 1471608621, 1472048847, '', '', '', 'DRWSS16044', 'N;', 25, 'N;', 0, 'peep-toe-flats', 0),
(207, 'Leather Bow Ballerinas', NULL, 1, '3400.00', '3400.00', '<p>These genuine leather ballerinas add class and sophistication to your outfit of choice.</p>\r\n', '', 1, 0, 1, 0, 1471612841, 1471613686, '', '', '', 'DRWSS16042', 'N;', 25, 'N;', 1, 'leather-bow-ballerinas', 0),
(208, 'Slip-On Sandals', NULL, 1, '2700.00', '2700.00', '<p>These&nbsp;leather sandals for women have an extremely soft footbed with latex nd memory foam cushioning. Easy to slip on and off, they are the perfect comfor-wear for women.</p>\r\n', '', 1, 0, 1, 0, 1471615837, 1471616036, '', '', '', 'DRWSS16025', 'N;', 25, 'N;', 0, '16025-slip-on-sandals', 0),
(209, 'Cross Strap Sandals', NULL, 1, '3000.00', '3000.00', '<p>3 Months</p>\r\n', '', 1, 0, 1, 0, 1471616240, 1471616377, '', '', '', 'DRWSS16024', 'N;', 25, 'N;', 0, '16024-cross-strap-sandals', 0),
(210, 'Peep Toe Heels', NULL, 1, '6000.00', '6000.00', '<p>Available in Patent Leather Green, Patent Leather Navy Blue and Leather Foil Golden</p>\r\n', '', 1, 0, 1, 0, 1471616906, 1471616978, '', '', '', 'DRWSS16059', 'N;', 24, 'a:2:{i:0;s:3:"182";i:1;s:3:"185";}', 1, '16059-peep-toe-heels', 0);
